import React from 'react';
import * as firebase from "firebase/app";

// Add Firebase services 
import "firebase/auth";
import "firebase/firestore";
//import "https://www.gstatic.com/firebasejs/6.0.2/firebase-app.js";
//import "https://www.gstatic.com/firebasejs/6.0.2/firebase-firestore.js";

var today = new Date();
var dd = String(today.getDate()).padStart(2, '0');
var mm = String(today.getMonth() + 1).padStart(2, '0'); //January is 0!
var yyyy = today.getFullYear();

today = mm + '/' + dd + '/' + yyyy;

var firebaseConfig = {
    apiKey: "AIzaSyBUWu46P2u56hwTx4ClhB8upvQBOdE-wWA",
    authDomain: "scheduler-188df.firebaseapp.com",
    databaseURL: "https://scheduler-188df.firebaseio.com",
    projectId: "scheduler-188df",
    storageBucket: "scheduler-188df.appspot.com",
    messagingSenderId: "1042925041868",
    appId: "1:1042925041868:web:dc80c0076e941eeb"
};

// Initialize Firebase
firebase.initializeApp(firebaseConfig);

var db = firebase.firestore();



// Add a new document in collection "cities"
db.collection("flights").add({
    name: "Los Angeles",
    country: "USA"
})
.then(function(docRef) {
    console.log("Document successfully written!", docRef.id);
})
.catch(function(error) {
    console.error("Error writing document: ", error);
});

function renderInfoBox(props) {
    return (
        <div className="infoBox">
            <div className="infoTitle">
                <h5>EVENING TWILIGHT</h5>
            </div>
            <div className="infoContent">
                <h5>CIVIL 2051 NAUT 2049</h5>
            </div>
        </div>
    )
}

function renderInfoBar(props) {
    return (
        <div className="info-bar">
            {renderInfoBox}
        </div>
    )
}

class Flights extends React.Component {
    render() {
        return (
            {renderInfoBar}
        )
    }
}

export default Flights;
